import PropTypes from 'prop-types'

const City = ({city}) => {
  return(
    <div className='city_container'>
      {city.CityName}
      <div className='weather_info'>
        {city.Weather}
        {city.Temp}
      </div>
      <button className='close_btn'>
      </button>
    </div>
  )
}

export default City
